import React from "react";
import { TextInput, StyleSheet } from "react-native";

export default function(props){
    return(
     <TextInput{...props} style={CSS.inputfeld}/>
    );
}
const css=StyleSheet.create({
    inputfeld:{
        borderButtonColor:'dodgeblue',
        borderButtomWidth:1,
        marginHorizontal:20,
        marginVertical:10,
        padding:10
}
});
